app.controller("help_bindwechat",["$scope","$rootScope","dialogService","storageService",function(n,t,i,r){n.title="绑定微信公众号";n.routeName="help_applywechat";n.identityCode=r.getIdentityCode();n.copyURL=function(n,t){var r=document.getElementById(n);r.focus();r.selectionStart=0;r.selectionEnd=r.value.length;document.execCommand("Copy");r.blur();i.showMention(1,"复制“"+t+"”网址成功")}}]);